import React from "react";
import "./SocialMedia.css";

// Define social media links and corresponding SVG paths
const socialMediaLinks = [
  {
    name: "Facebook",
    svgPath: "/assets/facebook.svg", // Replace with your custom SVG path
    link: "https://facebook.com",
  },
  {
    name: "Twitter",
    svgPath: "/assets/twitter.svg", // Replace with your custom SVG path
    link: "https://twitter.com",
  },
  {
    name: "Instagram",
    svgPath: "/assets/instagram.svg", // Replace with your custom SVG path
    link: "https://instagram.com",
  },
  {
    name: "LinkedIn",
    svgPath: "/assets/linkedin.svg", // Replace with your custom SVG path
    link: "https://linkedin.com",
  },
];

const SocialMedia = () => {
  return (
    <div className="social-media-container">
      {socialMediaLinks.map((icon, index) => (
        <a
          key={index}
          href={icon.link}
          target="_blank"
          rel="noopener noreferrer"
          aria-label={icon.name}
          className="social-media-icon"
        >
          <img
            src={icon.svgPath}
            alt={`${icon.name} icon`}
            className="social-media-icon-img"
          />
        </a>
      ))}
    </div>
  );
};

export default SocialMedia;
